import React from "react";
import './Form.css'

function Form(props) {
    return ( 
        <div className="form">
            <button id={props.form.key} onClick={props.setActiveForm} >{props.form.title}</button>
            <br/>
            {props.activeForm==props.form ? props.form.content : ''}
            
        </div>
     );
}

export default Form;
